const resultView = ({ location, custom, data }) => {
  return (
    <div>
      <h5>Searching for eating options in {location}</h5>
      <h1>Results</h1>

      <ul>
        {data.map((el, index) => {
          return <li key={index}>{el.name}</li>
        })}
      </ul>

    </div>
  );
};

export default resultView;
